define(["utils","gitee"],(function(i,n){return{data:()=>({searchTxt:"",links:[],cache:!0,headerLinks:[]}),methods:{open(i){this.searchTxt="",this.links=originLinks,window.open(i.url)},filter(){this.searchTxt||(this.links=originLinks);let i=this.searchTxt.toUpperCase();this.links=originLinks.filter((n=>-1!==n.title.toUpperCase().indexOf(i)||-1!==n.note.toUpperCase().indexOf(i)))},loadData(){n.getFileContent("data/pages.link.json",!1,!0).then((i=>{let n=i.map((i=>({title:i[0],url:i[1],note:i[2]})));originLinks=n,this.links=originLinks}))},refreshCache(){confirm("确认重新加载数据?")&&(this.cache=!1,this.loadData(),this.cache=!0)}},mounted(){this.loadData()},template:'\n        <div class="container mt-4">\n            <div class="row justify-content-center">\n                <div class="card m-1 yh-pointer col-md-4 col-lg-3" v-for="link in links" @click="open(link)">\n                    <div class="card-body">\n                        <h4 class="card-title">{{link.title}}</h4>\n                        <p class="card-text d-inline text-nowrap">{{link.note}}</p>\n                    </div>\n                </div>\n            </div>\n        </div>\n        '}}));